import React, { useEffect, useState } from 'react';
import styles from './DietPlanForm.module.css';
import Spinner from './Spinner';
import { fetchUserPreferences, getDietPlan, generateDietPlan } from '../services/api';

const DietForm = () => {
  const [userData, setUserData] = useState(null);
  const [dietPlan, setDietPlan] = useState(null);
  const [loading, setLoading] = useState(false);
  const [generating, setGenerating] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) return; // No token => do nothing or redirect

    setLoading(true);

    fetchUserPreferences(token)
      .then((data) => {
        if (!data) return;
        setUserData(data);
        return getDietPlan(token);
      })
      .then((plan) => {
        if (plan && plan.dietPlan) {
          // Try to parse as JSON first
          try {
            const parsed = JSON.parse(plan.dietPlan);
            setDietPlan(parsed);
          } catch (err) {
            // Fallback: parse as plain text
            setDietPlan(parseDietPlan(plan.dietPlan));
          }
        }
      })
      .catch((error) => {
        console.error('Error fetching diet plan:', error);
      })
      .finally(() => setLoading(false));
  }, []);

  /**
   * parseDietPlan
   * -----------
   * Fallback parser if the dietPlan is a plain text format. 
   * Splits the text by blank lines (\n\n) for each "day",
   * and then splits each day’s lines by " - ".
   *
   * Expected text format example:
   *    Day 1
   *    Breakfast - Oatmeal - with blueberries
   *    Lunch - Chicken Salad - with lettuce and tomatoes
   *
   *    Day 2
   *    Breakfast - Eggs - scrambled
   *    ...
   */
  const parseDietPlan = (dietPlanText = '') => {
    if (!dietPlanText.trim()) return [];

    return dietPlanText
      .split('\n\n') // Split into day blocks by blank lines
      .map((dayBlock) => {
        const lines = dayBlock.trim().split('\n').map((line) => line.trim());
        if (!lines.length) return null;

        // First line is "Day X" or similar
        const rawDayName = lines[0];
        // Remove "Day " prefix if it exists, so "Day 1" => "1"
        const dayNumber = rawDayName.replace(/^Day\s*/i, '');

        // Remaining lines describe meals
        const mealLines = lines.slice(1);
        const meals = mealLines.map((line) => {
          // Example line: "Breakfast - Oatmeal - with blueberries"
          const [type, meal, description] = line.split(' - ').map((str) => str.trim());
          return {
            type: type || 'Meal',          // e.g. "Breakfast"
            meal: meal || 'Untitled meal', // e.g. "Oatmeal"
            description: description || '' // e.g. "with blueberries"
          };
        });

        return {
          day: dayNumber, // e.g. "1"
          meals
        };
      })
      .filter(Boolean); // Remove any null entries
  };

  /**
   * handleGenerateDiet
   * -----------
   * Generates a new diet plan based on user preferences.
   * Some APIs return plain text, others return JSON. We handle JSON here.
   */
  const handleGenerateDiet = async () => {
    setGenerating(true);
    const token = localStorage.getItem('token');

    if (!userData) {
      console.error("No user preferences found!");
      setGenerating(false);
      return;
    }

    try {
      const response = await generateDietPlan(userData, token);
      if (response && response.data.dietPlan) {
        // If the API returns JSON, parse it
        const parsedDietPlan = JSON.parse(response.data.dietPlan);
        setDietPlan(parsedDietPlan);
      } else {
        console.error("API response doesn't contain a valid diet plan.");
      }
    } catch (error) {
      console.error("Error generating diet plan:", error);
    } finally {
      setGenerating(false);
    }
  };

  return (
    <div className={styles.dietPlanFormPage}>
      {/* Button to Generate Diet Plan */}
      <button
        className={styles.generateButton}
        onClick={handleGenerateDiet}
        disabled={generating}
      >
        {generating ? 'Generating...' : 'Generate Diet Plan'}
      </button>

      {/* Show a loading spinner while fetching existing plan */}
      {loading && (
        <div className={styles.spinnerContainer}>
          <Spinner />
        </div>
      )}

      {/* Display the diet plan if available */}
      {!loading && dietPlan ? (
        <div>
          {dietPlan.map((planItem, dayIndex) => (
            <div key={dayIndex} style={{ marginBottom: '2rem' }}>
              <h2>Day {planItem.day}</h2>
              <ul>
                {planItem.meals.map((meal, mealIndex) => (
                  <li key={mealIndex} style={{ margin: '0.5rem 0' }}>
                    <strong>{meal.type}:</strong> {meal.meal}
                    {meal.description ? ` — ${meal.description}` : ''}
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>
      ) : (
        !loading && (
          <p className={styles.noPlanMessage}>
            No diet plan available. Click "Generate Diet Plan" to create one updated.
          </p>
        )
      )}
    </div>
  );
};

export default DietForm;
